    let buttonArray = ['C', '/', '*', 7, 8, 9, '-', 4, 5, 6, '+', 1, 2, 3, '0', '00', '.', '='];
    // const buttonArrayHtml = 
    return (
        <div class="container">
            <form action="" name="calc" class="calculator">
                <Result />
                {buttonArray.map((btn) => {
                    // console.log(<Button btnValue={btn} />);
                    // <Button btnValue={btn} />
                    return <span class="num"><i> {btn} </i></span>
                })}
            </form>
        </div>
    );
}
export {Board};
